  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Carolina Sandhills
  National Wildlife Refuge summarizes refuge activities from January through August
  1943. The report begins with a summary of climatic conditions and fires during the
  period. The wildlife section of the report covers waterfowl, migratory birds, upland
  game birds, mammals, and fisheries resources. Refuge maintenance and development
  is also discussed. A public relations section outlines recreational use and refuge
  visitation. Photographs are provided at the end of the report\",\n\t\"owner_org\":
